Dylan's daughter had been acting up at school again. Not only did she miss practice, but she was caught blowing a dude. Let's just say that her coach isn't too impressed with her performance, and he's just about ready to kick her off the team. Lucky for her, Dylan knows just what to do. I guess it's just another case of, like mother like daughter..

